window.bookSummaryJSON = "<p>Graphic Audio introduces an Original Urban Fantasy trilogy available in no other format!</p><p></p><p>Jessica Shine is perhaps the most powerful magick user in the world. But even with all that power, she is trapped.</p><p></p><p>Trapped by the Midnight Project, a secret government agency charged with battling vampires, shape shifters and dark magicians. But in order to battle those evil forces, they have begun to create monsters of their own.</p><p></p><p>Monsters like Jessica Shine and her teammates, transformed with ancient rituals, arcane magicks and modern genetics to create supernatural warriors capable of defeating the dark forces threatening the world. But at what price?</p><p></p><p>After an operation gone wrong, Jessica and her team, vampire Ephram and shape shifter Nikolai, have gone rogue and are on the run from the very people who created them.</p><p></p><p>With the help of the mysterious hacker Ghost, they are on a cross country adventure to get answers about the Midnight Project and a deadly artifact–the Gladius Diablo–which might bring about the end of the world. </p><p></p><p>Produced with a full cast of actors, immersive sound effects and cinematic music!</p><p></p><p>Performed by Marissa Clay, Robb Moreira, Scott McCormick, RJ Bayley, Holly Adams, Torian Brackett, Danny Montooth, Jeri J. Marshall, Eric Messner, Rob McFadyen, Donald Guzzi, Marni Penning, Matthew Bassett, Christopher Williams, Karen Novack, Yasmin Tuazon, Christopher Walker, Jonathon Church, Steve Wannall, and Drew Kopas.</p>"; 
